import * as React from "react";
import { Text, TouchableOpacity, StyleSheet, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import DrawerNavigation from "./layouts/DrawerNavigation";
import PageLogin from "./Pages/PageLogin";
import PageInicio from "./Pagesexternas/PageInicio";
import TabNavigationExterna from "./Pagesexternas/TabNavigationExterna";
import Verinforme from "./Pagesexternas/Verinforme";
import VerGaleria from "./Pagesexternas/VerGaleria";
import VerAgenda from "./Pages/VerAgenda";
import VerNoticia from "./Pages/VerEvento";
import VerEvento from "./Pages/VerEvento";
import VerNovidade from "./Pages/VerNovidade";
const StackInicio = createNativeStackNavigator();

function NavegacaoInicio() {
  return (
    <StackInicio.Navigator initialRouteName="PageInicioApp">
      <StackInicio.Screen
        component={DrawerNavigation}
        name="AppInicio"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={PageLogin}
        name="PageLogin"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={TabNavigationExterna}
        name="PageInicioApp"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={Verinforme}
        name="PageVerinformeexterno"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={VerGaleria}
        name="PageVergaleriaexterno"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={VerAgenda}
        name="PageVerAgenda"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={VerEvento}
        name="PageVerEvento"
        options={() => ({ headerShown: false })}
      />
      <StackInicio.Screen
        component={VerNovidade}
        name="PageVerNovidade"
        options={() => ({ headerShown: false })}
      />
    </StackInicio.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <NavegacaoInicio />
    </NavigationContainer>
  );
}
